import base64

# Base64エンコードされた文字列
encoded_text = ""

# Base64デコード
decoded_bytes = base64.b64decode(encoded_text).decode('utf-8')

print(decoded_bytes)

# 異なる文字エンコーディングで試してみる
encodings = ['iso-2022-jp', 'shift_jis', 'cp932', 'euc_jp']

for encoding in encodings:
    try:
        decoded_text = decoded_bytes.decode(encoding)
        print(f"\n{encoding}でデコード:")
        print(decoded_text)
    except UnicodeDecodeError:
        print(f"{encoding}では失敗")